import React from 'react'
import { useGetTypesQuery } from '../../redux/api/server.api'

export default function TypesNavigation({setType}:any) {
    const {data:Types,isLoading}:any = useGetTypesQuery('')
    if(isLoading){
        return <p>fdsfs</p>
    }
  return (
    <div>
      {Types.map((el:any)=>
      <div onClick={setType('4')}>{el.name}</div>
      )}
    </div>
  )
}
